import React from 'react';
import styles from './buttons.scss';

class Buttons extends Component {
    render() {
      return (
        <div id="calendar" className="calendar">
        <div className="Header">
        <div className="calendar__weekAndDay">
               <div className="month">
                 <button type="button" id="monthButton" className="monthButton">
                   Month
                 </button>
               </div>
               <div className="week">
                 <button type="button" id="week" className="week">
                   Week
                 </button>
               </div>
               <div className="day">
                 <button type="button" id="day" className="day">
                   Day
                 </button>
               </div>
               </div>
               </div>
               </div>
               );
  }
}
export default Buttons;
